import data from './Data/data';
import Item from './Item/Item';

const ItemList = (props) =>{
    return(
        <div>
            {data.map ((product) =>{
                return <Item 
                key={product.id}
                title={product.title} 
                price={product.price}
                pictureUrl={product.pictureUrl} 
                />;
            })}
        </div>
    )
}

export default ItemList;
